import React, { useState } from "react";

function Random() {
  const [random, setRandom] = useState();

  function handleRandom() {
    setRandom();
  }

  return (
    <div>
      <button onClick={handleRandom}>
        Unsure on how you're feeling? Hit me!
      </button>
    </div>
  );
}

export default Random;
